import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core';
import { Grid } from '@material-ui/core';
import { Dashboard as DashboardLayout } from '../../layouts';
import { ArtCard } from './components';
import { images } from './preload-images.json';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import Gallery from 'react-photo-gallery';
import BlackImage from 'black.png';

const styles = theme => ({
  root: {
    backgroundImage: BlackImage,
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: '100%',
    height: '100%',
  },
});

class Dashboard extends Component {

  render() {
    const { classes } = this.props;
    var arr = [];
    images.forEach(function( img ) { arr.push({"src":require(img.src+""),"width":img.width,"height":img.height}) });
    console.log(arr.length);
    return (
      <DashboardLayout title="genlouise.art" >
          <Gallery photos={arr}/>
      </DashboardLayout>


    );
  }
}

Dashboard.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Dashboard);
